import SearchIcon from '@material-ui/icons/Search';
import InputBase from '@material-ui/core/InputBase';


function Password(props) {
    
  return (
    <Container >
    <Grid container spacing={3}>
      <Grid item xs>
        <Grid>
            <div>
            <SearchIcon />
            </div>
            <InputBase placeholder="Search" />
        </Grid>

       


      </Grid>

      <Grid item xs={8}>
        <Paper >xs</Paper>
      </Grid>

    </Grid>
  </Container>
  );
}
 
export default Password;
